const ImagemSetinha = require("../../assets/Seta.png");
const Header = () => {
  return (
    <View style={styles.header}>
      <View>
        <Image source={ImagemPerfil} style={styles.imagePerfil} />
      </View>
      <View style={styles.viewHeader}>
        <Text style={styles.text1Header}>Olá, Gabriel Cruz</Text>
        <Text style={styles.text2Header}>ag ••07 c/c •••97-6</Text>
      </View>
      <View>
        <TouchableOpacity>
          <Image source={ImagemSetinha} style={styles.imageSetinha} />
        </TouchableOpacity>
      </View>
    </View>
  );
};

export default Header;
